import React from 'react';
import PropTypes from 'prop-types';
import { Panel, Cell, List, PanelHeader, Group, Div } from '@vkontakte/vkui';

class Items extends React.Component {
    constructor(props) {
        super(props);

    }

    render() {
        let {id, items} = this.props
        return (
            <Panel id={id}>
                <PanelHeader>Товары</PanelHeader>
                <Group>
                    <List>
                        {
                            items.map((item, index) => (
                                <Cell
                                    key={index}
                                    before={
                                        <img
                                            style={{
                                                width: 40,
                                                height: 40,
                                                margin: 10
                                            }}
                                            src={item.thumb_photo}
                                        />
                                    }
                                    multiline
                                    description={item.description}
                                >
                                    {item.title}, {item.price.amount} {item.price.currency.name}
                                </Cell>
                            ))
                        }
						{
							items.length == 0 &&
							<Div>
								Хм, мы не нашли товаров.
							</Div>
						}
                    </List>
                </Group>
            </Panel>
        );
    }
}

Items.propTypes = {
	id: PropTypes.string.isRequired,
	go: PropTypes.func.isRequired,
	fetchedUser: PropTypes.shape({
		photo_200: PropTypes.string,
		first_name: PropTypes.string,
		last_name: PropTypes.string,
		city: PropTypes.shape({
			title: PropTypes.string,
		}),
	}),
};

export default Items;
